    {{-- form --}}
    <form class="input-form mt-20 flex justify-center items-center">
        <input class="input-text bg-slate-300 text-lg w-80 h-12 rounded-2xl text-black text-center font-semibold" placeholder="Pin" type="text">
    </form>
    {{-- button --}}
    <Button onclick="window.location.href='/home'" type="submit" class="btn-submit w-80 h-12 items-center mx-auto bg-slate-300 mt-8 rounded-2xl text-lg font-semibold text-gray-400" disabled>Login</Button>

<script>
    $(document).ready(function() {

        let currentInputVal = '';

        $('.input-text').on("input",function(){

            let value = $(this).val();
            currentInputVal = value;

            if (currentInputVal === '' ){
                $(this).removeClass('bg-white border-2 border-black');
                $(".btn-submit").addClass('bg-slate-300 text-gray-400');
                $(".btn-submit").removeClass('bg-green-600 text-white');
                $(".btn-submit").attr('disabled', true);
            }
            else{
                $(this).addClass('bg-white border-2 border-black');
                $(".btn-submit").removeClass('bg-slate-300 text-gray-400');
                $(".btn-submit").addClass('bg-green-600 text-white');
                $(".btn-submit").attr('disabled', false);
            } 
        });
    });
</script>
@endsection